import React from "react";
import { NavLink } from "react-router-dom";

//Styled Components
import { Title } from "../styledComponents/title";
import { MainContainer } from "../styledComponents/mainContainer";
import { GoodThingContainerBirdLeft } from "../styledComponents/goodThingContainerBirdLeft";
import { GoodThingContainerBirdRight } from "../styledComponents/goodThingContainerBirdRight";
import { MessageButton } from "../styledComponents/messageButton";
import { MessageContainer } from "../styledComponents/messageContainer";
import { HighlightedContainer } from "../styledComponents/hightlightedContainer";
import { InfoContainer } from "../styledComponents/infoContainer";
import { Boxtitle } from "../styledComponents/boxtitle";

import { HiOutlineLightBulb } from "react-icons/hi";
import { birbImages } from "../assets/birbs/birbsimgs";

export default function Messages() {
  return (
    <div>
      <Title>Post Pigeons<br/>from Friends</Title>

      <MainContainer>
      <MessageButton>
          <NavLink to="/newpost">
          <p>NAME one Dec, 20th 2023</p>
            <MessageContainer>
                <div className="birbsInARow">
            <img className="birdImg" src={birbImages.pigeon} alt="hi"></img>
        <img className="birdImg" src={birbImages.bigBirb20} alt="hi"></img>
        <img className="birdImg" src={birbImages.bigBirb15} alt="hi"></img>
        <img className="birdImg" src={birbImages.bigBirb02} alt="hi"></img>
        </div>
                </MessageContainer>

            
            </NavLink>
            </MessageButton>

      </MainContainer>

    </div>
  );
}
